function init_DataTables() {
    var DataTableArray = [];
    DataTableArray.push({ DataTableID: "#datatable-buttons" });
    DataTableArray.push({ DataTableID: "#datatable-buttons1" });
    DataTableArray.push({ DataTableID: "#datatable-buttons2" });
    DataTableArray.push({ DataTableID: "#datatable-buttons3" });
    DataTableArray.push({ DataTableID: "#datatable-buttons4" });
    DataTableArray.push({ DataTableID: "#datatable-buttons5" });
    DataTableArray.push({ DataTableID: "#datatable-buttons6" });
    DataTableArray.push({ DataTableID: "#datatable-buttons7" });
    DataTableArray.push({ DataTableID: "#datatable-buttons8" });
    DataTableArray.push({ DataTableID: "#datatable-buttons9" });
    DataTableArray.push({ DataTableID: "#datatable-buttons10" });
    DataTableArray.push({ DataTableID: "#datatable-buttons11" });
    DataTableArray.push({ DataTableID: "#datatable-buttons12" });
    DataTableArray.push({ DataTableID: "#datatable-buttons13" });
    DataTableArray.push({ DataTableID: "#datatable-buttons14" });
    DataTableArray.push({ DataTableID: "#datatable-buttons15" });
    DataTableArray.push({ DataTableID: "#datatable-buttons16" });
    DataTableArray.push({ DataTableID: "#datatable-buttons17" });
    DataTableArray.push({ DataTableID: "#datatable-buttons18" });
    DataTableArray.push({ DataTableID: "#datatable-buttons19" });
    DataTableArray.push({ DataTableID: "#datatable-buttons20" });
    DataTableArray.push({ DataTableID: "#datatable-buttons21" });
    DataTableArray.push({ DataTableID: "#datatable-buttons22" });
    DataTableArray.push({ DataTableID: "#datatable-buttons23" });
    DataTableArray.push({ DataTableID: "#datatable-buttons24" });
    DataTableArray.push({ DataTableID: "#datatable-buttons25" });
    if (console.log("run_datatables"), void 0 !== $.fn.DataTable) {
        console.log("init_DataTables");
        TableManageButtons = function() {
            "use strict";
            return {
                init: function () {
                    debugger;
                    for (let i = 0; i < DataTableArray.length; i++) {
                        $(DataTableArray[i].DataTableID).length && $(DataTableArray[i].DataTableID).DataTable({
                            dom: "Blfrtip",
                            pageLength: 50,
                            lengthMenu: [10, 25, 50, 100],
                            buttons: [{
                                extend: "copy",
                                className: "btn-sm"
                            }, {
                                extend: "csv",
                                className: "btn-sm",
                                title: function () {
                                    try {/*Modified By NItesh 08042025 For Add Change Excel File Name*/
                                        return Cmn_DataTableCSVFileName();
                                    }
                                    catch (ex) {
                                        return $("title").text();
                                    }
                                },
                                exportOptions: {
                                    columns: ':visible'
                                    ,
                                    format: {
                                        body: function (data, row, column, node) {
                                            // Remove HTML tags
                                            debugger;
                                            var text = $('<div>').html(data).text();

                                            // Remove line breaks, extra spaces, and commas
                                            text = text.replace(/\n/g, '').replace(/\s+/g, ' ').trim();
                                            text = text.replace(/,/g, '');

                                            // Optional: if cell has repeated total like "123.45   123.45", take only the first
                                            let parts = text.split(' ');
                                            if (parts.length > 1 && parts[0] === parts[parts.length - 1]) {
                                                text = parts[0];
                                            }

                                            return text;
                                        }
                                    }
                                }
                            }, {
                                extend: "excel",
                                className: "btn-sm"
                            }, {
                                extend: "pdfHtml5",
                                className: "btn-sm"
                            }, {
                                extend: "print",
                                className: "btn-sm"
                            }],
                            responsive: !0
                        })
                    }
                }
            }
        }(), $("#datatable").dataTable(), $("#datatable-keytable").DataTable({
            keys: !0
        }), $("#datatable-responsive").DataTable(), $("#datatable-scroller").DataTable({
            ajax: "js/datatables/json/scroller-demo.json",
            deferRender: !0,
            scrollY: 380,
            scrollCollapse: !0,
            scroller: !0
        }), $("#datatable-fixed-header").DataTable({
            fixedHeader: !0
        });
        var e = $("#datatable-checkbox");
        e.dataTable({
            order: [
                [1, "asc"]
            ],
            columnDefs: [{
                orderable: !1,
                targets: [0]
            }]
        }), e.on("draw.dt", function() {
            $("checkbox input").iCheck({
                checkboxClass: "icheckbox_flat-green"
            })
        }), TableManageButtons.init()
    }
}

 $(document).ready(function() {
     init_DataTables();
});